import React from 'react';

function List(props) {

  const { locations } = props;

  return(
  <ol id="footer">
    {locations.map((location, index) => (
    <li key={index}
            value={index}
            className="filter-option"
        >{location.title}</li>
    ))}
  </ol>
  )
}


export default List
